import React from "react";
import Icon from "./icon";

const Like = (props) => {
  let classes = "fa fa-heart";
  if (!props.liked) {
    classes += "-o";
  }

  return <Icon id="heart-icon" className={classes} onClick={props.onClick} />
};

export default Like;
